import React, { Component } from "react";
import "./styles.scss";

class Cart extends Component {
  render() {
    return (
      <>
        <div className="compare-title">
          <h2>Compare</h2>
          <div className="amount-product">2 product(s)</div>
        </div>
      </>
    );
  }
}

export default Cart;
